function App() {
    var count = 0;
    function increase() {
        count++;
         return (<div>
            <button>{count}</button>
            <button onClick={increase}>+</button>
        </div>)
            ,document.getElementById("root");
    }
    return (
        <div>
            <button>{count}</button>
            <button onClick={increase}>+</button>
        </div>
    )

}




export default App;
